import "./App.css";
import React, { useEffect, useState } from "react";
function App() {

  const [data, setData] = useState("");
  const [change, setChange] = useState("")

  useEffect(() => {
    async function fetchData() {
      let response = await fetch(
       `https://api.openweathermap.org/data/2.5/weather?q=Smederevska Palanka&appid=${process.env.REACT_APP_API_KEY}`
      );
      let data = await response.json();
      setData(data);
    }
    fetchData();

  }, []);

  return <div className="App">
    <input type='text' className='something' onChange={input => setChange(input.event)}/>
    {
    console.log(change)}
  </div>
}

export default App;
